import * as React from 'react';
import { styled, createTheme, ThemeProvider, } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import { purple } from '@mui/material/colors';

const Theme = createTheme({
  palette: {
    teste: {
      main: '#11cb5f',
      contrastText: '#98FB98',
    },
      primary: {
        light: '#112233',
        main: '#445566',
        dark: '#778899',
        contrastText: '#fff',
      },
  },
});

const verde = Theme.palette.teste;

const BootstrapButton = styled(Button)({
  boxShadow: 'none',
  display: 'flex',
  textTransform: 'none',
  fontSize: 16,
  padding: '6px 12px',
  border: '1px solid',
  lineHeight: 1.5,
  backgroundColor: '#0063cc',
  borderColor: '#0063cc',
  fontFamily: [
    '-apple-system',
    'BlinkMacSystemFont',
    '"Segoe UI"',
    'Roboto',
    '"Helvetica Neue"',
    'Arial',
    'sans-serif',
    '"Apple Color Emoji"',
    '"Segoe UI Emoji"',
    '"Segoe UI Symbol"',
  ].join(','),
  '&:hover': {
    backgroundColor: '#0069d9',
    borderColor: '#0062cc',
    boxShadow: 'none',
  },
  '&:active': {
    boxShadow: 'none',
    backgroundColor: '#0062cc',
    borderColor: '#005cbf',
  },
  '&:focus': {
    boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
  },
});

 const ColorButton = styled(Button)(({ Theme }) => ({
  color: verde,
  color: theme.palette.getContrastText(purple[500]),
  backgroundColor: verde,
  '&:hover': {
    backgroundColor: verde,
  },
}));

export default function Palette() {
  return (
    <ThemeProvider theme={Theme}>
      <ColorButton /* color="primary" */ variant="contained">Secondary</ColorButton>
    </ThemeProvider>
  );
}

